INSERT INTO crmhelp VALUES("1", "Download query result as CSV export file", "When checked, the result of your search query will be \'pushed\' as an CSV-export file. \r\n<br><br>\r\nThis means that you will <b>not</b> see the result on screen, but  you\'ll jump to the CSV page. On that page you can select wich fields you want to export.<br><br>\r\nSee also help on <a href=\'help.php?id=4\' class=\'topnav\'>\'Exporting data to Excel\'</a>");
INSERT INTO crmhelp VALUES("2", "Include entity contents", "When checked, this function as a result will include the textual content of an entity in the summary. ");
INSERT INTO crmhelp VALUES("3", "Include deleted entities", "When checked, the query you created by using the pull-down boxes will also be ran over deleted entities in the database.\r\n<br><br>\r\nUse this function when searching for an enitity not knowing wheter or this entity is still available.\r\n<br><br>\r\nWhen found, you can easily undelete an entity by clicking \'Update in new window\' followed by unchecking the \'This is a deleted entity\' checkbox. Do not forget to click \'Save and close\' when you\'re done.");
INSERT INTO crmhelp VALUES("4", "Exporting data to CSV (Excel)", "CSV stands for Character Separated Values.\r\n<br><br>\r\nYou can select the fields in the database you want to export. If you are unsure, just check all the boxes. You will now export all data in the database but the binairy files (the attachments).\r\n<br><br>\r\nBy clicking \'Download exportfile\' you will immediately see a download dialog box. Click \'Open\', and, if it appears again, click \'Open\' again.\r\n<br><br>\r\nIf you are looking for an export of an particular part of the database you can use the summary page, and check the \'Download result as CSV file\' option. See also help on <a href=\'help.php?id=1\' class=\'topnav\'>\'Download query result as CSV export file\'</a>.\r\n");
INSERT INTO crmhelp VALUES("5", "Adding and modifing owners/assignees", "You can modify owners/assignees by just clicking the name and altering the text.\r\n<br><br>\r\nUsing the last field you can add owners/assignees, one at the time.\r\n<br>\r\nIf a owner or assignee logs in with a limited account (which have to be created seprately using the same name), the user will only have rights to view the entities assigned to him- or herself, with the only right to add comments to the textual content and the right to attach files.\r\n<br><br>\r\n<b>Important!</b>\r\n<br>\r\nDo not switch users! CRM-CTT works by the number, not the name!");
INSERT INTO crmhelp VALUES("6", "Adding and modifing customers", "You can modify customers by just clicking the name and altering the text.\r\n<br><br>\r\nUsing the last field you can add customers, one at the time.\r\n<br><br>\r\n<b>Important!</b>\r\n<br>\r\nDo not switch customers! CRM-CTT works by the number, not the name!");
INSERT INTO crmhelp VALUES("7", "Fulltext search through all entities", "When typing a word, or part of it, in the \'Enitity must contain text\'-field, CRM-CTT will search through the database for entities with that exact word in the \'Category\' or the content.\r\n<br><br>\r\nWhen you\'ve also checked \'Include enitity contents\', the content will be <font color=ff3300><u>red-highlighted</u></font> when your search matched.\r\n<br><br>\r\nWildcard searches or logical-operand searches are <b>not</b> supported.");
INSERT INTO crmhelp VALUES("8", "Management Information", "Management Information displays summaries of data gathered from the database. These summaries are mostly statistics.\r\n<br><br>\r\nCheck the summaries you want to see. If you check more boxes, the output will be longer. \r\n<br><br>\r\nIf you check all boxes, remember this slows down the server, so maybe you\'ll have to wait a little.");
INSERT INTO crmhelp VALUES("9", "Attach a file", "Using this function you can attach a file to an enitity.\r\n<br><br>\r\nBy clicking \'browse\' you\'ll see a file select box. Browse to the file you want to attach. Click \'open\' and the path to the file will appear in the field box.\r\n<br><br>\r\nAfter you\'ve saved the enitity, the file will be attached.\r\n<br><br>\r\nYou can only attach one file at the time!\r\n");
INSERT INTO crmhelp VALUES("10", "This entity is waiting for somebody else\'s action", "By checking this box you let CRM-CTT know that the entity you\'re working on is stalled because somebody else has to undertake action first.\r\n<br><br>\r\nThis is mainly for management information purposes. Though; you can also use this as a search option when using the summary page.");
INSERT INTO crmhelp VALUES("11", "This entity really doesn\'t belong here.", "By checking this box you let CRM-CTT know that the entity you\'re working on really should not be logged in this CRM.\r\n<br><br>\r\nThis is mainly for management information purposes.");
INSERT INTO crmhelp VALUES("12", "This is a deleted entity", "When you check this box, <b>you delete the entire entity although it might not yet be closed.</b>\r\n<br><br>\r\nWhen the checkbox was already checked an you uncheck it, you <b>undelete</b> the entity.\r\n");
INSERT INTO crmhelp VALUES("13", "<center><b>Disclaimer</b></center>", "<center>(logo?)</center><br><i><b>ALL INFORMATION CONTAINED IN THIS WEBSITE IS CONFIDENTIAL</b><br><br>\r\n Although, with respect to documents available from this server, neither the author nor any other involved supplier makes any warranty, express or implied, including the warranties of merchantability and fitness for a particular purpose, or assumes any legal liability or responsibility for the accuracy,  completeness, or usefulness of any information, apparatus, product, or process disclosed, or represents that its use would not infringe privately owned rights. This should be perfectly clear for anybody who uses this website. Don\'t agree? Too bad! Be warned!</i><br>\r\n");
INSERT INTO crmhelp VALUES("14", "S.O.B.", "S.O.B. stands for <i>Standard Operational B*llsh*t</i>");
INSERT INTO crmhelp VALUES("16", "Quickmenu to entities", "You can use the <i>little</i> fieldbox in the header of every page to quickly jump to an entity.<B>You can only enter entity-numbers in this box!</b>When you enter a valid number and press TAB or ENTER you will instantly jump to the edit window of that entity.\r\n<br><br>\r\nThe <i>large</i> fieldbox is the searchbox from the summary page. When you enter a text in this box, CRM-CTT will search all entities for matching records.");
INSERT INTO crmhelp VALUES("17", "Logging into the CRM", "You can only login to this application if a username and a password was provided to you.<br><br>\r\nIf you should be able to get in, but you cannot, use the e-mail adress as shown on the login page to send an email to the administrator of this site.\r\n<br><br>\r\nClicking Save Username will save your used username to your machine using a so-called cookie. By clicking Clear Username the cookie will be deleted. The same goes for the password.");
INSERT INTO crmhelp VALUES("18", "Brief entity overview matching query", "By checking the Brief Overview box the result of you search query will be displayed in the format of the Brief Entity Overview. This may come in handy working with queries with many matches.");
INSERT INTO crmhelp VALUES("19", "Download PDF report or summary", "Using this function you can download a file in Adobe Acrobat format which contains information about a certain entity. You can also download the management summary and an export of the phonebook in PDF-format.");
