INSERT INTO crmsettings VALUES("11", "navtype", "TABS", "20060601164543", "Navigation bar type. Use NOTABS for normal navigation, anything else for tabs");
INSERT INTO crmsettings VALUES("12", "langoverride", "No", "20060601164543", "Language override. No to let the user be able to choose his or her own language, yes to disable this feature and thereby force the use of the system-wide language choosen hereunder.");
INSERT INTO crmsettings VALUES("13", "EmailNewEntities", "", "20060601164543", "The e-mail address to which notifications of added entities should be mailed. Leave empty for no notification.");
INSERT INTO crmsettings VALUES("14", "MonthsToShow", "7", "20060601164543", "The number of months to show in the various calendar appearances.");
